window.bookSummaryJSON = "<p>I’d been stalking her for years. My little witch was always just out of reach. But tonight, I’d gotten her scent. She could run as fast and as far as she liked. It made no difference. I would find her. And when I did, I’d drag my little witch to The Underworld to be my bride. My queen. My goddess forever.</p> <p>I was powerless against his shadows, unable to do anything as the demon split the earth and The Realm of the Living fell away. He expected me to be terrified, but my life had already ended before he captured me. Death magic was ravaging our world, claiming hundreds of souls, and my twenty-first birthday was next month, the night when my life would be sacrificed to strengthen the weakening Earth Coven.</p> <p>I'd thought Hades was my damnation, but he might just hold the key to awakening my magic and saving us all.</p> <p>Things to know about Spring's Descent:</p> <p>Hades and Persephone retelling</p> <p>Enemies to lovers</p> <p>Dark Romance Fantasy</p> <p>Witches &amp; Gods</p> <p>Found family</p> <p>Duel POV</p> <p>Possessive love interest</p> <p>Arranged marriage</p> <p>HEA</p> <p>This book contains dark themes that may be triggering to some.</p>"; 
